    - type: Paper
      content: >+
        [bold]SCP-1488-RU - Горячая линия спасения уличных шлюх Алфорда-Кеннеди, вы пробовали выключить и снова включить?[/bold]



        Совокупное обозначение SCP-1488 присвоено звонкам в службы спасения по всему миру, перехваченным предполагаемой аномальной сущностью. Такой исходящий звонок с телефонного аппарата регистрируется на узлах связи/АТС как прерванный инициатором, который, несмотря на это, устанавливает связь и продолжает разговор с SCP-1488, выдающей себя за оператора линии помощи. После соединения с аномалией большая часть функций телефона субъекта блокируется, прервать этот звонок возможно лишь механическим отключением аппарата. Другие входящие вызовы во время разговора с SCP-1488 не проходят по различным неаномальным причинам, но при этом никак не отображаются для самого субъекта.


        Речь и поведение SCP-1488 в целом соответствует ожидаемым от диспетчера служб спасения, за исключением того, что действия, которые объект рекомендует совершить с пострадавшим, которому требуется немедленная помощь, не направлены на выход из критической ситуации или сохранение жизни, несмотря на утверждение обратного. Не удалось однозначно определить, следует ли субъект этим инструкциям в силу когнитивных/меметических триггеров, скрытых в речи SCP-1488, или же аномалия выбирает людей, склонных в состоянии аффекта следовать даже абсурдным указаниям с внешней компетентной стороны.


        Предположительно, пострадавший, которому оказывается помощь по рекомендациям от SCP-1488, остается жив несмотря на любые повреждения до момента прерывания звонка.


        SCP-1488 всегда говорит женским голосом на основном языке страны текущего расположения субъекта, но почти все жертвы отмечали нетипичный акцент, соответствующий финно-угорской языковой группе. На основе единственной полученной в контролируемой среде записи разговора с SCP-1488 лингвисты Фонда определили акцент как соответствующий [УДАЛЕНО].


        Иногда SCP-1488 якобы осуществляет параллельные соединения с профильными специалистами медицинских иных служб, голоса и имена которых соответствуют реальным сотрудникам упомянутых служб. На данный момент все подобные сотрудники отрицали получение звонков и имели алиби на момент воздействия аномалии.


        Разумность SCP-1488 не установлена. В ходе контролируемого контакта подтвердились предположения о том, что, несмотря на адаптивность реакций оператора в ходе звонка, аномалия оперирует только данными, которые так или иначе были записаны ранее.



